def removeZeroSumSublists(head):
    prefix_sum = 0
    seen = {}
    dummy = ListNode(0)
    dummy.next = head
    curr = dummy

    while curr:
        prefix_sum += curr.val
        if prefix_sum in seen:
            curr = seen[prefix_sum].next
            temp_sum = prefix_sum + curr.val
            while temp_sum != prefix_sum:
                del seen[temp_sum]
                curr = curr.next
                temp_sum += curr.val
            seen[prefix_sum].next = curr.next
        else:
            seen[prefix_sum] = curr
        curr = curr.next

    return dummy.next
